#include<bits/stdc++.h>
using namespace std;

int main()
{
    long long n,m,i,j,k;
    char str[500][1050];

 //   strcpy(str[0],"0");
 //   strcpy(str[0],"1");
    str[0][0]='0';
    str[1][0]='1';
    str[0][1]='\0';
    str[1][1]='\0';

    cout<<str[0]<<endl<<str[1]<<endl;

    for(i=2;i<5001;i++)
    {
        int a=strlen(str[i-2]);
        int b=strlen(str[i-1]);

        for(j=a-1,k=0;k<b-a;k++,j++)
            str[i-2][j]='0';
        str[i-2][j]='\0';
        //cout<<str[i-2]<<endl;
    }

    while(cin>>n)
    {
        vector<long long>v;
     //   char str[]="";
     //   cout<<strlen(str)<<endl;
        v.push_back(0);
        v.push_back(1);

        for(i=2;i<=n;i++)
            v.push_back(v[i-1]+v[i-2]);

        cout<<v[n]<<endl;;
    }
    return 0;
}
